import React, { Component } from 'react';

class AboutUs extends Component {
    render(){
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col s9'>About</div>
                    <div className='col s3'>
                        <img className="responsive-img" src="../../../../public/"/>
                    </div>
                </div>
            </div>
        )
    }
}

export default AboutUs
